create table bike
(
    id              BIGINT(19) auto_increment comment '编号'
        primary key,
    bike_barcode    VARCHAR(255)         null comment '车辆条码',
    lock_barcode    VARCHAR(20)          null comment '智能锁条码',
    jurisdiction_id BIGINT(19)           null comment '所属辖区',
    create_time     BIGINT(19)           null comment '创建时间',
    update_time     BIGINT(19)           null comment '修改时间',
    creator         VARCHAR(255)         null comment '创建者',
    updater         VARCHAR(255)         null comment '修改者',
    register_no     VARCHAR(255)         null comment '鉴权码',
    iccid           VARCHAR(255)         null comment 'sim卡iccid号',
    status          BIGINT(19)           null comment '车辆状态',
    user            VARCHAR(255)         null comment '骑行人',
    phone           VARCHAR(255)         null comment '联系电话',
    type            VARCHAR(255)         null comment '车辆类型',
    bike_icon       VARCHAR(255)         null comment '图标',
    unlock_mode     INT(10)    default 2 null comment '1-无需开锁；2-扫码开锁；',
    bike_seq        BIGINT(19) default 0 null comment '排序序号',
    show_real_line  VARCHAR(10)          null,
    color           VARCHAR(10)          null
)
    collate = utf8_bin;

